import React, { useEffect } from 'react'
import axios from 'axios'


export default function Books() {
    useEffect(()=>{
        async function getBooks() {
            const res=await axios.get('http:127.')
            console.log(res.data)
        }
        getBooks()
    },[])

  return (
    <div>Books</div>
  )
}
